import "./App.css";
import ExpenseItem from "./Components/ExpenseItem.js";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "car",
      amount: 782,
      date: new Date(2022,1,2),
    },
    {
      id: "e2",
      title: "TV",
      amount: 222,
      date: new Date(2022,1,2),
    },
    {
      id: "e3",
      title: "book",
      amount: 21,
      date: new Date(2022,1,2),
    },
    {
      id: "e4",
      title: "T Shirt",
      amount: 30,
      date: new Date(2020,6,17),
    },
  ];

  return (
    <div className="App">
      {expenses.map((expense) => (
        <ExpenseItem
          key={expense.id}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      ))}
    </div>
  );
}

export default App;
